import React, { useState } from "react";
import { Link } from "react-router-dom";
import "./TraineeRegisterPage.css";

function TraineeRegisterPage() {
  

  const [traineeForm, setTraineeForm] = useState({
    fullName: "",
    email: "",
    contactNumber: "",
    candidateId: "",
    dob: "",
    password: "",
    confirmPassword: "",
  });

  
  const handleTraineeFormChange = (event) => {
    const { name, value } = event.target;
    setTraineeForm((prevForm) => ({ ...prevForm, [name]: value }));
  };

  

  const handleTraineeFormSubmit = (event) => {
    event.preventDefault();
    // TODO: handle form submission
  };

  return (
    <center>
    <div style={{ backgroundColor: "grey" }}>
      <h1>Employee Onboarding Portal</h1>
      <div style={{ display: "flex" }}>
        
        <form onSubmit={handleTraineeFormSubmit}>
          <h2>Register as Trainee</h2>
          <label>
            Full Name:
            <input
              type="text"
              name="fullName"
              value={traineeForm.fullName}
              onChange={handleTraineeFormChange}
              required
            />
          </label>
          <br />
          <label>
            Personal Email Id:
            <input
              type="email"
              name="email"
              value={traineeForm.email}
              onChange={handleTraineeFormChange}
              required
            />
          </label>
          <br />
          <label>
            Contact Number:
            <input
              type="tel"
              name="contactNumber"
              value={traineeForm.contactNumber}
              onChange={handleTraineeFormChange}
              required
            />
          </label>
          <br />
          <label>
            Candidate Id:
            <input
              type="text"
              name="candidateId"
              value={traineeForm.candidateId}
              onChange={handleTraineeFormChange}
              required
            />
          </label>
          <br />
          <label>
            Date of Birth:
            <input
              type="date"
              name="dob"
              value={traineeForm.dob}
              onChange={handleTraineeFormChange}
              required
            />
          </label>
          <br />
          <label>
            Create Password:
            <input
              type="password"
              name="password"
              value={traineeForm.password}
              onChange={handleTraineeFormChange}
              required
            />
          </label>
          <br />
          <label>
            Confirm Password:
            <input
              type="password"
              name="confirmPassword"
              value={traineeForm.confirmPassword}
              onChange={handleTraineeFormChange}
              required
            />
          </label>
          <br />
          <Link to="/trainee-sign-in-page">
            <button type="submit">Register</button>
          </Link>
          <br />
          <p style={{ textAlign: "left" }}>Already registered?</p>
          {/* <button>Sign In</button> */}
          <a href="/trainee-sign-in-page">
            <h2>Sign In</h2>
          </a>
        </form>
      </div>
    </div>
    </center>
  );
}

export default TraineeRegisterPage;
